import { Button, Space, Form, Typography } from 'antd';
import React from 'react';
import { useParams } from 'react-router-dom';
import moment from 'moment';
const { Text, Link } = Typography;
const Exam = () => {
	const userId = localStorage.getItem('userId');
	const { id } = useParams();
	const endDate = moment('2021-02-09 17 17:16', 'YYYY-MM-DD HH:mm');
	return (
		<Form>
			<Space>
				<Form.Item>
					<Text>Remain Time :{moment().subtract(endDate.hour, 'hour')}</Text>
				</Form.Item>
				<Form.Item>
					<Button>Submit</Button>
				</Form.Item>
				<Form.Item>
					<Form.List></Form.List>
				</Form.Item>
			</Space>
		</Form>
	);
};
export default Exam;
